import { useState } from "react";
import "./newProduct.css";

export default function NewProduct() {
  const[inputs, setInputs] = useState({})
  const[file, setFile] = useState(null)
  const[cate, setCat] = useState([])

  const handleChange = (e)=>{
    setInputs(prev=>{
      return{...prev, [e.target.name]:e.target.value}
    })
  } 

  const handleCat = (e)=>{

  } 

  console.log(inputs)
  return (
    <div className="newProduct">
      <h1 className="addProductTitle">New Product</h1>
      <form className="addProductForm">
        <div className="addProductItem">
          <label>Image</label>
          <input type="file" id="file" onChange={e=>setFile(e.target.files)[0]}/>
        </div>
        <div className="addProductItem">
          <label>Title</label>
          <input name="title" type="text" placeholder="Yo-lakki" onChange={handleChange} />
        </div>
        <div className="addProductItem">
          <label>Product description</label>
          <input name="desc" type="text" placeholder="sopii hyvin lukiolaisille..." onChange={handleChange} />
        </div>
        <div className="addProductItem">
          <label>Price</label>
          <input name="price" type="number" placeholder="49" onChange={handleChange} />
        </div>
        <div className="addProductItem">
          <label>Categories</label>
          <input type="text" placeholder="lakki,yo-lakki,valkoinen" onChange={handleCat} />
        </div>
        <div className="addProductItem">
          <label>Stock</label>
          <select name="inStock" onChange={handleChange}>
            <option value="true">Yes</option>
            <option value="false">No</option>
          </select>
        </div>
        <button className="addProductButton">Create</button>
      </form>
    </div>
  );
}
